import React from "react";
import "./App.css";
import Header from "./components/Header";

const Body: React.FC = () => {
  function counter() {
    return <h1>hello</h1>;
  }
  return (
    <>
      <form>
        <table>
          <tr>
            <td>Restaurant name:</td>
            <td>
            <input
              id="searchName"
              className="searchName"
              type="text"
              name="restaurant  "
            />
            </td>
          </tr>
          <tr>
            <td>Review:</td>
            <textarea name="comment"></textarea>
          </tr>
          <tr>Ranting</tr>
          <tr>
          <input
              type="number"
              id="points"
              name="points"
              step="1"
            />
          </tr>
          <tr>
          <button type="submit" value="Submit">
              Save
            </button>
            <button type="reset" value="Reset">
              Cancel
            </button>
            <button>Delete</button>
          </tr>
        </table>
      </form>
    </>
  );
};

const App: React.FC = () => {
  return (
    <div className="body">
      <Header />
      <Body />
    </div>
  );
};

export default App;
